p.x:
var $bm_rt;
var quality, radius, startAngle, xt, yt;
quality = clamp(effect('Quality')('ADBE Slider Control-0001'), 0.1, 1000);
radius = div(effect('Extrude')('ADBE Slider Control-0001'), quality);
startAngle = degreesToRadians(sub(effect('Angle')('ADBE Angle Control-0001'), 90));
xt = sum(value[0], mul(radius, Math.cos(startAngle)));
yt = sum(value[1], mul(radius, Math.sin(startAngle)));
$bm_rt = [
    xt,
    yt
];

